import React from "react";
import { useEffect, useState } from "react";

const Lastmatcheng = () => {
  const [data, setData] = useState([]);
  const array = data[0];

  useEffect(() => {
    const options = {
      method: "GET",
      headers: {
        "X-RapidAPI-Key": "b529891cd2mshe7bca90aba3fe87p1dabf4jsnaea3d94ce638",
        "X-RapidAPI-Host": "football98.p.rapidapi.com",
      },
    };

    fetch("https://football98.p.rapidapi.com/premierleague/results", options)
      .then((response) => response.json())
      .then((data) => {
        setData(data);
      })
      .catch((err) => console.error(err));
  }, []);

  return (
    <div className="text-white shadow-xl top-0 w-[500px] h-[450px] bg-white"></div>
  );
};

export default Lastmatcheng;
